script: |
  super -f text -I q5533.spq | sort > q5533.out

inputs:
  - name: q5533.spq
    data: |
      SELECT DISTINCT * FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT - 43 IN ( + - col0 * - - col0, ( + - 21 ) / col1, CAST ( 63 AS INTEGER ), - + 48 / - col2 * col0 );
  - name: tab2

outputs:
  - name: q5533.out
    data: |
      46	51	23
      64	77	40
      75	67	58
